    "2015-06-19T13:49:42.285074",nt"name": "coastal-study-dukes-countymassachusetts-usa",nt"isopen":
    false,nt"url": null,nt"notes": "Coastal study data as defined in FEMA Guidelines
    and Specifications, Appendix D: Guidance for Coastal Flooding Analyses and Mapping,
    submitted as a result of a coastal study. Appendix D notes that a variety of analytical
    methodologies may be used to establish Base (1-percent-annual-chance) Flood Elevations
    (BFEs) and floodplains throughout coastal areas of the United States. Appendix D
    itemizes references for the methodologies currently in use by FEMA for specific
    coastal flood hazards, provides general guidance for documentation of a coastal
    flood hazard analysis, specifies flood hazard analysis procedures for the Great
    Lakes coasts, and outlines intermediate data submissions for coastal flood hazard
    analyses with new storm surge modeling and revised stillwater flood level (SWFL).
    (Source: FEMA Guidelines and Specs, Appendix D Guidance for Coastal Flooding Analyses
    and Mapping, Section D.1)",nt"license_title": null,nt"extras": [{ntt"key":
